	(4185, 105, 'texto_app', '<h1><strong><span style="color: #489781;">Consultas na palma da mão</span></strong></h1>\r\n<span style="color: #000000;">Telemedicina, como é chamada a consulta médica feita a distância, e que cada vez mais está na palma das mãos dos pacientes . Basta baixar o aplicativo no smartphone ou acessar o site no computador e solicitar a consulta no momento que o paciente desejar. O médico fica à disposição 24h não importando onde quer que o seu paciente esteja, evitando grandes esperas nas UPA\'s e pronto atendimento presencial.</span>\r\n\r\n<a href="#"><img class="alignnone size-full wp-image-34" src="http://e9.test/wp-content/uploads/2022/08/imagem_2022-08-13_171810954.png" alt="" width="153" height="46" /></a>   <a href="#"><img class="alignnone size-full wp-image-35" src="http://e9.test/wp-content/uploads/2022/08/imagem_2022-08-13_171820892.png" alt="" width="153" height="46" /></a>\r\n\r\n&nbsp;'),
