	(5229, 116, 'texto_quem_somos', '<h1 style="text-align: center;"><span style="color: #000000;"><strong>Quem somos?</strong></span></h1>\r\n<span style="color: #000000;">Somos uma empresa 100% digital, oferecemos Pronto Atendimento em clínica medica 24h por dia todos os dias da semana, com médicos capacitados e aptos ao atendimento medico em qualquer lugar por telemedicina, basta acessar pelo app ou pagina web e solicitar o atendimento.</span>\r\n\r\n<span style="color: #000000;">Além disso nossos cliente possuem um cartão de benefícios onde as empresas parceiras disponibilizam serviços de saúde tais como: medicina diagnostica, exames laboratoriais, diagnostico por imagem, medicina especializada, multidisciplinar entre outras a um preço acessível com descontos incríveis.</span>\r\n\r\n<span style="color: #000000;">Levamos a privacidade e a segurança muito a sério. Implementamos protocolos de segurança e criptografia de última geração para garantir que a integridade e a privacidade dos dados sejam mantidas.</span>\r\n\r\n<span style="color: #000000;">Como resultado, o Médico online está em conformidade com os requisitos HIPAA, GDPR, PHIPA/PIPEDA e HITECH.</span>\r\n<span style="color: #000000;">Sendo assim, entregamos o acesso à uma plataforma 100% digital que atende suas necessidades médicas de consultas e orientações médica. Não somos um plano de saúde, apenas oferecemos atendimento médicos</span>'),
	(5230, 116, '_texto_quem_somos', 'field_630437a62b1c2'),
	(5231, 116, 'pilares_0_pilar', '<img class="size-full wp-image-113 aligncenter" src="http://e9.test/wp-content/uploads/2022/08/imagem_2022-08-22_231659800.png" alt="" width="101" height="90" />\r\n<h4 style="text-align: center;"><strong><span style="color: #000000;">MISSÃO</span></strong></h4>\r\n<p style="text-align: center;"><span style="color: #000000;">Nossa missão e levar atendimento medico 100% digital através da telemedicina no conforto do seu lar, presando sempre pela ética, qualidade, bem-estar e segurança dos nossos clientes.</span></p>'),
	(5232, 116, '_pilares_0_pilar', 'field_630437ce2b1c4'),
	(5233, 116, 'pilares_1_pilar', '<img class="size-full wp-image-114 aligncenter" src="http://e9.test/wp-content/uploads/2022/08/imagem_2022-08-22_231754133.png" alt="" width="89" height="100" />\r\n<h4 style="text-align: center;"><span style="color: #000000;"><strong>VISÃO</strong></span></h4>\r\n<p style="text-align: center;"><span style="color: #000000;">Ser referência em saúde 100% digital, crescendo de forma sustentável, com soluções inovadoras, mantendo e gerando conhecimento, atraindo talentos e cuidando das pessoas em todas as fases da vida.</span></p>'),
	(5234, 116, '_pilares_1_pilar', 'field_630437ce2b1c4'),
	(5235, 116, 'pilares_2_pilar', '<span style="color: #000000;"><img class="size-full wp-image-115 aligncenter" src="http://e9.test/wp-content/uploads/2022/08/imagem_2022-08-22_231838413.png" alt="" width="100" height="99" /></span>\r\n<h4 style="text-align: center;"><strong><span style="color: #000000;">OBJETIVOS</span></strong></h4>\r\n<p style="text-align: center;"><span style="color: #000000;">Atendimento diferenciado, personalizado e humanizado 100% digital.</span>\r\n<span style="color: #000000;">Compromisso com o fazer seguro e bem feito. </span>\r\n<span style="color: #000000;">Cuidado com a imagem institucional da empresa e parceiros.</span>\r\n<span style="color: #000000;">Valor para a sociedade visão de longo prazo - inovação, pioneirismo, perenidade e sustentabilidade.</span>\r\n<span style="color: #000000;">Responsabilidade com resultados nas diversas dimensões.</span></p>'),
